// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

import './App.css';
import Booklist from './components/Booklist/Booklist';

function App() {
  return (
    <Router>
      <Routes>
        <div className="App">
          <Booklist />
        </div>
      </Routes>
    </Router>
  );
}

export default App;
